          <div
            className="mt-[30px] w-[95%] max-w-[730px] lg:pt-[250px] relative"
            data-aos="fade-right"
            data-aos-delay="200"
          >
            <h2 className="text-[26px] font-bold text-center mb-[15px] font-poppins text-green-1">
              {activeIndex === 0 && "Taman Nasional Gunung Rinjani"}
              {activeIndex === 1 && "Hutan Adat"}
              {activeIndex === 2 && "Rumah Maggot Senaru"}
              {activeIndex === 3 && (
                <>
                  Jambu Mete (<span className="italic">Anacardium occidentale</span>)
                </>
              )}
              {activeIndex === 4 && (
                <>
                  Kakao (<span className="italic">Theobrema Cacao l.</span>)
                </>
              )}
              {activeIndex === 5 && (
                <>
                  Kopi (<span className="italic">Coffea</span>)
                </>
              )}
              {activeIndex === 6 && "Mata Air"}
              {activeIndex === 7 && "Sawah Adat"}
              {activeIndex === 8 && (
                <>
                  Vanili (<span className="italic">Vanilla planifolia)</span>
                </>
              )}
            </h2>
            <p className="text-[16px] sm:text-[18px] md:text-[19px] text-center">
              {activeIndex === 0 &&
                "Kabupaten Lombok Utara menjadi seksi konservasi wilayah I yang mengelola Taman Nasional Gunung Rinjani bagian Lombok Utara. TNGR sendiri terbagi ke dalam dua wilayah yaitu Lombok Utara dan Lombok Timur. Terdapat empat resort di wilayah I ini yaitu Resort Senaru, Torean, Santong, Aik Berik, dan beberapa pos jaga lainnya. Seksi Pengelolaan Taman Nasional Wilayah I TNGR berlokasi di Desa Senaru di sepanjang Jalan Wisata. Desa Bayan dan Desa Senaru masuk ke dalam wilayah pengelolaan taman nasional karena berlokasi di kaki Gunung Rinjani. Senaru sendiri masuk ke dalam salah satu jalur pendakian yang cukup terkenal untuk bisa menaiki Rinjani."}
              {activeIndex === 1 &&
                "Hutan Adat Bayan merupakan hutan milik masyarakat adat bayan yang dikelola melalui hukum adat Awiq-awiq. Terdapat empat hutan adat yang tersebar di Desa Bayan diantaranya Hutan Adat Mandala, Hutan Adat Bangket Bayan, Hutan Adat Pangempokan, dan Hutan Adat Tiu Rarangan, beberapa diantaranya memiliki mata air sebagai sumber pengairan warga Desa Bayan dan desa sekitarnya. Di dalamnya terdapat beberapa spesies hewan seperti monyet ekor panjang (Macaca fascicularis) dan lutung (Trachypithecus) serta spesies tumbuhan seperti pohon beringin (Moraceae), pohon kenari (Canarium ovatum), dan jelatang (Laportea cuspidata). "}
              {activeIndex === 2 &&
                "Rumah budidaya maggot merupakan salah satu hasil dari program kerja dari tim KKN UGM untuk dapat mengatasi permasalahan sampah di Lombok Utara. Berlokasi tidak jauh dengan TPS 3R, rumah budidaya maggot dibangun di Dusun Omah Segoar Desa Senaru sebagai bentuk upaya mengatasi permasalahan sampah sisa makanan. Maggot yang dikembangkan merupakan jenis maggot BSF (Black Soldier Fly) yang ketika dewasa akan berubah menjadi lalat BSF yang akan bertelur dan kembali menghasilkan maggot. Maggot juga dapat dimanfaatkan untuk pakan ikan dan pakan burung."}
              {activeIndex === 3 &&
                "Pohon ini banyak ditemukan di sekitar jalan dan kebun warga. Jambu mete adalah salah satu komoditas ekspor yang bernilai tinggi, terutama karena bijinya (kacang mete) yang merupakan produk utama dengan permintaan global yang terus meningkat. Produksi jambu mete juga relatif menguntungkan bagi petani, karena tanaman ini mampu tumbuh dengan baik di lahan kering dan marginal. Tanaman ini telah banyak dibudidayakan di Lombok Utara namun belum banyak inovasi olahan yang dapat dikembangkan dari tanaman ini."}
              {activeIndex === 4 &&
                "Kakao banyak tumbuh di kebun warga. Masyarakat biasa menikmati buah kakao tanpa adanya pengolahan lebih lanjut. Buah kakao memiliki rasa yang unik dan kompleks. Daging buahnya, yang disebut pulp, berwarna putih dan memiliki rasa manis, asam, dan sedikit fermentasi yang mirip dengan buah tropis lainnya seperti manggis atau rambutan. Selain disantap langsung sebagai buah, kakao dimanfaatkan sebagai tambahan rasa untuk komoditas kopi."}
              {activeIndex === 5 &&
                "Kebun kopi banyak ditanam di hutan sebagai salah satu praktik agroforestry. Lombok Utara disebut sebagai penghasil kopi terbaik karena memiliki rasa yang khas. Jenis kopi yang ditanam di Pulau Lombok merupakan varietas unggul dengan kondisi tapak yang sesuai untuk pertumbuhan kopi. Selain itu, metode pengolahan kopi yang dilakukan masih dilakukan dengan cara tradisional. Beberapa kopi memiliki cara pengolahan yang khas dengan ditumbuk atau dirujak. Jenis kopi yang dimiliki adalah jenis kopi robusta dan kopi arabica."}
              {activeIndex === 6 &&
                "Beragamnya sumber daya alam dan potensi yang ada di Kecamatan Bayan tidak lepas dari kondisi alam yang juga mendukung. Tradisi dan adat istiadat yang diwariskan oleh leluhur mereka terus dijaga dengan penuh rasa hormat. Salah satu warisan penting adalah budaya konservasi yang diterapkan oleh nenek moyang mereka dan dilindungi oleh peraturan adat. Mata air di dalam hutan adat Bayan menjadi salah satu bentuk warisan yang telah dijaga oleh leluhur dari waktu yang lama. Mata air ini mengalir dan dimanfaatkan untuk kehidupan masyarakat Kecamata Bayan."}
              {activeIndex === 7 &&
                "Sawah adat merupakan salah satu bentuk warisan budaya yang masih dilestarikan hingga saat ini. Sawah tradisional ini dimiliki dan dikelola oleh pejatu. Sawah adat di Desa Bayan masih memegang erat hukum adat yang berlaku yaitu awiq-awiq. Kesepakatan adat yang berlaku yaitu larangan memakai alat modern dalam pengelolaan sawah. Alat yang dipakai untuk membajak sawah hingga saat ini memakai kerbau atau sapi. Sawah ini terletak di Dusun Teres Genit dan ada di dalam kawasan hutan Bangket Bayan. Tidak hanya keunikan dalam pengelolaannya, sawah ini menyajikan keindahan bentuk terasering yang menakjubkan."}
              {activeIndex === 8 &&
                "Vanili adalah tanaman yang dapat menghasilkan cita rasa vanilla. Vanili  merupakan  salah  satu  jenis  tanaman  perkebunan  yang  bernilai  ekonomi  tinggi dengan harga yang relatif stabil. Petani di Lombok Utara telah banyak membudidayakan tanaman ini dalam skala perkebunan. Vanili terus dikembangkan karena secara geografis sangat cocok dibudidayakan khususnya di wilayah selatan Desa Bayan dan Senaru yang memiliki ketinggian  pada rentan yang cocok untuk pertumbuhan vanili yaitu kisaran 300-1500 mdpl. Peningkatan ekonomi melalui potensi agro dapat dilakukan salah satunya dengan mengembangkan budidaya tanaman ini karena iklim dan lokasi yang mendukung."}
            </p>
          </div>
